var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'WEEK', 'text': '', 'tags': '', 'url': 'WEEK.html'}, {'title': 'WEEk1', 'text': '\xa0\xa0建立倉儲cd2020&進行網站編譯 \n \n 登入github並建立新倉儲cd2020 \n 輸入\xa0git clone\xa0 https://github.com/s40723135/cd2020.git \n 執行git submodule add\xa0 https://github.com/mdecourse/cmsimde.git \xa0取得子模組資料 \n 把 up_dir 的所有項目複製到資料夾cd2020 \n 即可執行python wsgi.py編輯網站 \n', 'tags': '', 'url': 'WEEk1.html'}, {'title': 'WEEk2', 'text': '將可攜系統中的 python3.7.3 更新至 python3.8.2 版本 \n ．收尋\xa0 Python 官網。 ．點選Downloads下的 Windows ，並點選\xa0 Latest Python 3 Release - Python 3.8.2 。 ．找到\xa0 Windows x86-64 executable installer \xa0 並下載。 ．開始下載，必須將 \xa0 pip 選項 取消 \n ．建立新的start.bat \n start.bat: \n \n \n \n \n @echo off set Disk=y subst %Disk%: "data" %Disk%: set HomePath=%Disk%:\\home_mdecourse set HomeDrive=%Disk%:\\home_mdecourse set Home=%Disk%:\\home_mdecourse set USERPROFILE=%Disk%:\\home_mdecourse REM 將系統 Python 程式的 io 設為 utf-8 set PYTHONIOENCODING="utf-8" set PYTHONPATH=%Disk%:\\py38\\DLLs;%Disk%:\\py38\\Lib;%Disk%:\\py38\\Lib\\site-packages; set PYTHONHOME=%Disk%:\\py38 REM for flutter set java_home=%Disk%:\\java\\jdk8u222-b10 set ANDROID_SDK_home=%Disk%:\\home_mdecourse set GRADLE_USER_home=%Disk%:\\home_mdecourse set ANDROID_SDK_ROOT=%Disk%:\\android\\sdk set ANDROID_Home=%Disk%:\\android\\sdk\\tools REM for putty set GIT_HOME=%CDisk%:\\portablegit\\bin\\ set GIT_SSH=%Disk%:\\putty\\plink.exe set path_python=%Disk%:\\py38;%Disk%:\\py38\\Scripts; set path_msys2=%Disk%:\\msys64\\mingw64\\bin; REM coreutils is for compiling fossil scm set path_coreutils=%Disk%:\\coreutils-5.3.0\\bin;%Disk%:\\depends22_x64; set path_tcc=%Disk%:\\tcc; set path_cmake=%Disk%:\\cmake-3.10.1-win64-x64\\bin; set path_nodejs=%Disk%:\\nodejs;%Disk%:\\nodejs\\appdata\\roaming\\npm; set path_git=%Disk%:\\portablegit\\bin; set path_xming=%Disk%:\\Xming; set path_latex=%Disk%:\\Pandoc;%Disk%:\\TinyTeX\\bin\\win32; set path_flutter=%Disk%:\\java\\jdk8u222-b10\\bin;%Disk%:\\flutter\\bin;%Disk%:\\Android\\sdk;%Disk%:\\Android\\sdk\\tools;%Disk%:\\Android\\sdk\\tools\\bin;%Disk%:\\Android\\sdk\\platform-tools;%Disk%:\\flutter\\bin\\cache\\dart-sdk\\bin;%Disk%:\\vscode; set path_putty=%Disk%:\\putty; path=%Disk%:;%path_python%;%path_msys2%;%path_tcc%;%path_git%;%path_cmake%;%path_coreutils%;%path_flutter%;%path_putty%;%path_latex%;%path%; start /MIN cmd.exe start /MIN cmd.exe start /MIN cmd.exe start /MIN cmd.exe start /MIN %Disk%:\\wscite415\\wscite\\SciTE.exe start /MIN %Disk%:\\wscite415\\wscite\\SciTE.exe Exit \n \n \n \n ．執行指令，將python3.8.2版本缺少的模組下載下來。 \n \n \n \n \n \n \n 1 \n \n \n \n python get - pip.py \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n 2 \n \n \n \n pip install flask bs4 lxml pelican markdown flask_cors leo \n \n \n \n \n \n \n \n \n ．下載MSYS2\xa0 msys2-x86_64-20190524.exe \xa0至data下。 \n ．下載SciTE系統\xa0 full 64-bit download ，下載完後解壓縮至data下的wscite432。 \n ．下載PortableGit\xa0 64-bit Git for Windows Portable \xa0至\xa0portablegit下。 ．安裝pip，到 https://bootstrap.pypa.io/get-pip.py 頁面，另存新檔到data下。', 'tags': '', 'url': 'WEEk2.html'}, {'title': 'WEEk3', 'text': '', 'tags': '', 'url': 'WEEk3.html'}, {'title': 'WEEk4', 'text': '', 'tags': '', 'url': 'WEEk4.html'}, {'title': 'WEEk5', 'text': '', 'tags': '', 'url': 'WEEk5.html'}, {'title': 'WEEk6', 'text': '安裝OBSPortable.exe與yotube做配合,往後拍影片,頭像左下角需要有自己的影像', 'tags': '', 'url': 'WEEk6.html'}, {'title': 'WEEk7', 'text': '四輪機器人 \n 安裝 https://coppeliarobotics.com/downloads \n 隨機直播 \n https://youtu.be/f5B92zdtKTI', 'tags': '', 'url': 'WEEk7.html'}, {'title': 'WEEk8', 'text': '如何架設直播課程 \n 1.至 OBS官網 下載安裝軟體 \n 2.將YOUTU/TWITCH的串流金鑰，複製進OBS的設定-串流內 \n \n \n 3.在OBS按下開始串流，並到YOUTU開始直播 \n \n 使用Ivcam進行攝像頭視訊 \n 1.在手機及電腦上下載 Ivcam 安裝軟體 \n 2.將手機以usb連接電腦，並將電腦與手機使用同一個網路進行連接 \n', 'tags': '', 'url': 'WEEk8.html'}, {'title': 'WEEk9', 'text': '\n', 'tags': '', 'url': 'WEEk9.html'}]};